import {useState , useEffect} from 'react';
function Custome(i){
const [email , setEmail] = useState(i);
const [pass , setpass] = useState("");
function Success(){
    window.alert('Login is success')
}
function Danger(){
    window.alert('Login is danger')
}
return{
    email ,pass , Success , Danger 
}
}
export default Custome ;
